package mesbah;

public class Test {

	
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		print();
	}
	
	
	static int x = 25;
	static int y = 50;
	  
	public static void print() {

		System.out.println("Hello Mesbah "+(x == y));
		System.out.println("Hello Mesbah "+(x != y));
		System.out.println("Hello Mesbah "+(x <= y));
		System.out.println("Hello Mesbah "+(x >= y));
		System.out.println("Hello Mesbah "+(x > y));
		System.out.println ("Hello Mesbah "+(x < y));


	}
}
